import '../../styles.css'
import './appstyle.css'
// import 'bootstrap/dist/css/bootstrap.min.css';
import { NavbarBrand, Navbar, NavbarText, Container, Input } from 'reactstrap'
import Nav from '../Navbar'
import Card from '../Card'
import Form from '../Form'
import bgImage from "../../assests/bgimg.jpg"
import React from 'react';

const App = () => {
  const bgUrl=require("../../assests/bgimg.jpg");
  const bgstyle={
    
    backgroundImage:`url(${bgUrl})`,
    height:"800px",
    backgroundSize: "contain",
    backgroundRepeat:"no-repeat",
    backgroundPosition:"top center",
    alignItems:"center",
    }
  
  return (
    <div className="App">
      <Nav />
      {/* <Container style={{backgroundImage:`url(${example})`,height:"800px", backgroundSize: "contain", backgroundRepeat:"no-repeat", backgroundPosition:"center"}}> */}
      <Container style={bgstyle}>
        <div style={{align:"center"}}>
      <Form />
      </div>
      </Container>
      <Container className="bg-light border" >
        <Card />
      </Container>
    </div>

  );
}

export default App;
